/**
 * 用户代理管理对象
 * @author zhongjyuan
 * @email zhognjyuan@outlook.com
 * @website http://zhongjyuan.club
 * @date 2023年12月15日17:36:35
 */
const userAgentManagement = {
	/**默认用户代理 */
	defaultUserAgent: app.userAgentFallback,

	/**是否存在自定义用户代理设置 */
	hasCustomUserAgent: false,

	/**自定义用户代理 */
	customUserAgent: app.userAgentFallback,

	/**
	 * 获取 Firefox 用户代理
	 * @returns {string} Firefox 用户代理
	 */
	getFirefoxUA: function () {
		/**不同操作系统的根用户代理 */
		const rootUAs = {
			mac: "Mozilla/5.0 (Macintosh; Intel Mac OS X 10.15; rv:FXVERSION.0) Gecko/20100101 Firefox/FXVERSION.0",
			windows: "Mozilla/5.0 (Windows NT 10.0; WOW64; rv:FXVERSION.0) Gecko/20100101 Firefox/FXVERSION.0",
			linux: "Mozilla/5.0 (X11; Ubuntu; Linux x86_64; rv:FXVERSION.0) Gecko/20100101 Firefox/FXVERSION.0",
		};

		/**根据不同操作系统获取相应的根用户代理 */
		let rootUA;

		if (isWindows) {
			rootUA = rootUAs.windows;
		} else if (isMac) {
			rootUA = rootUAs.mac;
		} else {
			rootUA = rootUAs.linux;
		}

		/*
		 * 根据时间计算出合适的 Firefox 版本号，以字符串的形式拼接 Firefox 用户代理
		 * 假设每次发布新版本的时间间隔为 4.1 周，从 2021 年 8 月 10 日开始计算
		 */
		const fxVersion = 91 + Math.floor((Date.now() - 1628553600000) / (4.1 * 7 * 24 * 60 * 60 * 1000));

		return rootUA.replace(/FXVERSION/g, fxVersion);
	},

	/**
	 * 启用谷歌用户代理切换功能
	 * @param {Electron.Session} session - 当前会话
	 */
	enableGoogleUASwitcher: function (session) {
		session.webRequest.onBeforeSendHeaders((details, callback) => {
			// 如果不存在自定义用户代理设置且请求 URL 包括 accounts.google.com，则修改请求头 User-Agent，模拟 Firefox 浏览器访问 Google 账号页面
			if (!userAgentManagement.hasCustomUserAgent && details.url.includes("accounts.google.com")) {
				const url = new URL(details.url);
				if (url.hostname === "accounts.google.com") {
					details.requestHeaders["User-Agent"] = userAgentManagement.getFirefoxUA();
				}
			}

			// 设置额外的请求头信息以模拟 Chromium 浏览器
			const chromiumVersion = process.versions.chrome.split(".")[0];
			details.requestHeaders["SEC-CH-UA"] = `"Chromium";v="${chromiumVersion}", " Not A;Brand";v="99"`;
			details.requestHeaders["SEC-CH-UA-MOBILE"] = "?0";

			callback({ cancel: false, requestHeaders: details.requestHeaders });
		});
	},

	/**
	 * 初始化函数
	 */
	initialize: function () {
		// 如果存在自定义用户代理设置，则使用设置的用户代理，否则对默认用户代理进行处理
		if (settingManagement.get("customUserAgent")) {
			userAgentManagement.hasCustomUserAgent = true;
			userAgentManagement.customUserAgent = settingManagement.get("customUserAgent");
		} else {
			// 默认用户代理处理
			customUserAgent = userAgentManagement.defaultUserAgent
				.replace(/Electron\/\S+\s/, "") // 去除 Electron 标识
				.replace(/ZHONGJYUAN\/\S+\s/, "") // 去除 ZHONGJYUAN 标识
				.replace(
					process.versions.chrome,
					process.versions.chrome
						.split(".")
						.map((v, idx) => (idx === 0 ? v : "0"))
						.join(".")
				); // 将 Chrome 版本号调整为以 0 结尾的格式
		}

		// 设置用户代理
		app.userAgentFallback = userAgentManagement.customUserAgent;

		// 在应用准备就绪时启用谷歌用户代理切换功能
		app.once("ready", function () {
			userAgentManagement.enableGoogleUASwitcher(session.defaultSession);
		});

		// 在每次创建新的会话时启用谷歌用户代理切换功能
		app.on("session-created", userAgentManagement.enableGoogleUASwitcher);
	},
};

userAgentManagement.initialize();;
/**
 * 权限管理对象
 * @author zhongjyuan
 * @email zhognjyuan@outlook.com
 * @website http://zhongjyuan.club
 * @date 2023年12月15日17:45:18
 */
const permissionManagement = {
	/**下一个权限ID，默认为1 */
	nextPermissionId: 1,

	/**待处理的权限请求数组 */
	pendingPermissions: [],

	/**已经授予的权限数组 */
	grantedPermissions: [],

	/**
	 * 将权限发送到渲染器进程
	 */
	sendPermissionsToRenderers: function () {
		// 将所有请求发送到所有窗口 - 每个窗口的选项卡栏将决定要显示什么
		windowManagement.getOpenWins().forEach(function (win) {
			sendIPCToWindow(
				win,
				"updatePermissions",
				// 序列化权限对象并删除不能通过IPC序列化的属性
				permissionManagement.pendingPermissions.concat(permissionManagement.grantedPermissions).map((p) => {
					return {
						permissionId: p.permissionId,
						tabId: p.tabId,
						origin: p.origin,
						permission: p.permission,
						details: p.details,
						granted: p.granted,
					};
				})
			);
		});
	},

	/**
	 * 移除指定内容的权限
	 * @param {Electron.WebContents} contents WebContents对象
	 */
	removePermissionsForContents: function (contents) {
		// 过滤掉待处理和已授予的权限中与指定内容匹配的权限
		permissionManagement.pendingPermissions = permissionManagement.pendingPermissions.filter((perm) => perm.contents !== contents);

		permissionManagement.grantedPermissions = permissionManagement.grantedPermissions.filter((perm) => perm.contents !== contents);

		permissionManagement.sendPermissionsToRenderers();
	},

	/**
	 * 判断指定来源和权限是否已经授权
	 * @param {*} requestOrigin
	 * @param {*} requestPermission
	 * @param {*} requestDetails
	 * @returns
	 */
	isPermissionGrantedForOrigin: function (requestOrigin, requestPermission, requestDetails) {
		for (var i = 0; i < permissionManagement.grantedPermissions.length; i++) {
			if (requestOrigin === permissionManagement.grantedPermissions[i].origin) {
				if (requestPermission === "notifications" && permissionManagement.grantedPermissions[i].permission === "notifications") {
					return true;
				}

				if (requestPermission === "pointerLock" && permissionManagement.grantedPermissions[i].permission === "pointerLock") {
					return true;
				}

				if (requestPermission === "media" && permissionManagement.grantedPermissions[i].permission === "media") {
					// 类型 1：来自 permissionCheckHandler 的请求只有一个媒体类型
					if (requestDetails.mediaType && permissionManagement.grantedPermissions[i].details.mediaTypes.includes(requestDetails.mediaType)) {
						return true;
					}

					// 类型 2：来自 permissionRequestHandler 的请求有多个媒体类型
					// TODO：现有的授予的权限应该合并在一起（即如果存在音频的现有权限，并且视频的另一个权限，对音频+视频的新请求应该被批准，但目前不会被批准）
					if (
						requestDetails.mediaTypes &&
						requestDetails.mediaTypes.every((type) => permissionManagement.grantedPermissions[i].details.mediaTypes.includes(type))
					) {
						return true;
					}

					// 类型 3：没有特定类型的一般媒体权限，在授予更具体的权限类型后立即出现
					if (!requestDetails.mediaType && !requestDetails.mediaTypes && permissionManagement.grantedPermissions[i].permission === "media") {
						return true;
					}
				}
			}
		}
		return false;
	},

	/**
	 * 判断是否存在指定来源和权限的待处理请求
	 * @param {*} requestOrigin
	 * @param {*} permission
	 * @param {*} details
	 * @returns
	 */
	hasPendingRequestForOrigin: function (requestOrigin, permission, details) {
		for (var i = 0; i < permissionManagement.pendingPermissions.length; i++) {
			if (
				requestOrigin === permissionManagement.pendingPermissions[i].origin &&
				permission === permissionManagement.pendingPermissions[i].permission
			) {
				return true;
			}
		}
		return false;
	},

	/**
	 * 页面权限请求处理程序
	 * @param {*} webContents
	 * @param {*} permission
	 * @param {*} callback
	 * @param {*} details
	 * @returns
	 */
	pagePermissionRequestHandler: function (webContents, permission, callback, details) {
		if (permission === "fullscreen") {
			callback(true);
			return;
		}

		if (!details.isMainFrame) {
			// 目前不支持以简化UI
			callback(false);
			return;
		}

		if (!details.requestingUrl) {
			callback(false);
			return;
		}

		if (permission === "clipboard-sanitized-write") {
			callback(true);
			return;
		}

		let requestOrigin;
		try {
			requestOrigin = new URL(details.requestingUrl).hostname;
		} catch (e) {
			// 无效的URL
			console.warn(e, details.requestingUrl);
			callback(false);
			return;
		}

		/*
		地理位置需要谷歌API密钥（https://www.electronjs.org/docs/api/environment-variables#google_api_key），因此已禁用。
		其他权限目前不支持以简化UI
		*/
		if (["media", "notifications", "pointerLock"].includes(permission)) {
			/*
			如果此来源在不同选项卡中先前获得了权限，新请求应该被允许
			*/
			if (permissionManagement.isPermissionGrantedForOrigin(requestOrigin, permission, details)) {
				callback(true);

				// 将新授予的权限添加到已授予权限数组中
				if (!permissionManagement.grantedPermissions.some((grant) => grant.contents === webContents && grant.permission === permission)) {
					permissionManagement.grantedPermissions.push({
						permissionId: permissionManagement.nextPermissionId,
						tabId: viewManagement.getViewIDFromWebContents(webContents),
						contents: webContents,
						origin: requestOrigin,
						permission: permission,
						details: details,
						granted: true,
					});

					permissionManagement.sendPermissionsToRenderers();
					permissionManagement.nextPermissionId++;
				}
			} else if (permission === "notifications" && permissionManagement.hasPendingRequestForOrigin(requestOrigin, permission, details)) {
				/*
				网站有时会为每个通知发出新请求，如果第一个请求未被批准，则可能生成多个请求。
				TODO：这不完全正确（某些请求将被拒绝，而应该是待处理的） - 正确的解决方案是在UI中显示一个按钮来批准所有请求。
				*/
				callback(false);
			} else {
				// 将待处理的权限请求添加到待处理权限数组中
				permissionManagement.pendingPermissions.push({
					permissionId: permissionManagement.nextPermissionId,
					tabId: viewManagement.getViewIDFromWebContents(webContents),
					contents: webContents,
					origin: requestOrigin,
					permission: permission,
					details: details,
					callback: callback,
				});

				permissionManagement.sendPermissionsToRenderers();
				permissionManagement.nextPermissionId++;
			}

			/*
			一旦此视图关闭或导航到新页面，这些权限应该被撤销
			*/
			webContents.on("did-start-navigation", function (e, url, isInPlace, isMainFrame, frameProcessId, frameRoutingId) {
				if (isMainFrame && !isInPlace) {
					permissionManagement.removePermissionsForContents(webContents);
				}
			});

			webContents.once("destroyed", function () {
				// 检查应用程序是否正在关闭以避免Electron崩溃（TODO 删除此项）
				if (windowManagement.getOpenWins().length > 0) {
					permissionManagement.removePermissionsForContents(webContents);
				}
			});
		} else {
			callback(false);
		}
	},

	/**
	 * 页面权限检查处理程序
	 * @param {*} webContents
	 * @param {*} permission
	 * @param {*} requestingOrigin
	 * @param {*} details
	 * @returns
	 */
	pagePermissionCheckHandler: function (webContents, permission, requestingOrigin, details) {
		if (!details.isMainFrame && requestingOrigin !== details.embeddingOrigin) {
			return false;
		}

		if (permission === "clipboard-sanitized-write") {
			return true;
		}

		let requestHostname;
		try {
			requestHostname = new URL(requestingOrigin).hostname;
		} catch (e) {
			// 无效的URL
			console.warn(e, requestingOrigin);
			return false;
		}

		return permissionManagement.isPermissionGrantedForOrigin(requestHostname, permission, details);
	},

	/**
	 * 初始化函数
	 */
	initialize: function () {
		// 应用程序准备就绪时，设置权限请求和权限检查处理程序
		app.once("ready", function () {
			session.defaultSession.setPermissionRequestHandler(permissionManagement.pagePermissionRequestHandler);
			session.defaultSession.setPermissionCheckHandler(permissionManagement.pagePermissionCheckHandler);
		});

		// 当会话创建时，为会话设置权限请求和权限检查处理程序
		app.on("session-created", function (session) {
			session.setPermissionRequestHandler(permissionManagement.pagePermissionRequestHandler);
			session.setPermissionCheckHandler(permissionManagement.pagePermissionCheckHandler);
		});

		ipc.on("permissionGranted", function (e, permissionId) {
			for (var i = 0; i < permissionManagement.pendingPermissions.length; i++) {
				if (permissionId && permissionManagement.pendingPermissions[i].permissionId === permissionId) {
					permissionManagement.pendingPermissions[i].granted = true;
					permissionManagement.pendingPermissions[i].callback(true);
					permissionManagement.grantedPermissions.push(permissionManagement.pendingPermissions[i]);
					permissionManagement.pendingPermissions.splice(i, 1);

					permissionManagement.sendPermissionsToRenderers();

					break;
				}
			}
		});
	},
};

permissionManagement.initialize();;
/**
 * 提示管理对象
 * @author zhongjyuan
 * @email zhognjyuan@outlook.com
 * @website http://zhongjyuan.club
 * @date 2023年12月15日17:55:19
 */
const promptManagement = {
	/**存储用户的选择结果 */
	promptAnswer: null,

	/**存储提示框的选项 */
	promptOptions: null,

	/**
	 * 创建提示框窗口
	 * @param {*} options 提示框的选项
	 * @param {*} callback 回调函数，用于返回用户的选择结果
	 */
	createPrompt: function (options, callback) {
		/**解构选项对象，获取父窗口、宽度和高度等属性 */
		promptManagement.promptOptions = options;

		const { parent, width = 360, height = 140 } = options;

		/**创建一个 BrowserWindow 对象，用于显示提示框 */
		var promptWindow = new BrowserWindow({
			width: width,
			height: height,
			parent: parent != null ? parent : windowManagement.getCurrentWin(),
			show: false,
			modal: true,
			alwaysOnTop: true,
			title: options.title,
			autoHideMenuBar: true,
			frame: false,
			webPreferences: {
				nodeIntegration: false,
				sandbox: true,
				contextIsolation: true,
				preload: __dirname + "/src/pages/prompt/prompt.js",
			},
		});

		// 在提示框窗口关闭时触发 "closed" 事件，并调用回调函数将用户选择结果作为参数传递给它
		promptWindow.on("closed", () => {
			promptWindow = null;
			callback(promptManagement.promptAnswer);
		});

		// 加载提示框的 HTML 页面
		promptWindow.loadURL("file://" + __dirname + "/src/pages/prompt/index.html");

		// 在窗口准备好显示后展示出来
		promptWindow.once("ready-to-show", () => {
			promptWindow.show();
		});
	},

	/**
	 * 初始化函数
	 */
	initialize: function () {
		// 监听 "show-prompt" 事件，当渲染器进程发送该事件时，调用 createPrompt 函数并传递相关选项和回调函数
		ipc.on("show-prompt", function (options, callback) {
			promptManagement.createPrompt(options, callback);
		});

		// 监听 "open-prompt" 事件，当渲染器进程请求打开提示框时，返回一个包含提示框文本、按钮标签等信息的 JSON 字符串作为返回值。
		ipc.on("open-prompt", function (event) {
			event.returnValue = JSON.stringify({
				label: promptManagement.promptOptions.text,
				ok: promptManagement.promptOptions.ok,
				values: promptManagement.promptOptions.values,
				cancel: promptManagement.promptOptions.cancel,
				darkMode: settingManagement.get("darkMode"),
			});
		});

		// 监听 "close-prompt" 事件，当提示框窗口关闭时，将用户的选择结果保存在 promptAnswer 变量中。
		ipc.on("close-prompt", function (event, data) {
			promptManagement.promptAnswer = data;
		});

		// 监听 "prompt" 事件，当渲染器进程发送该事件时，调用 createPrompt 函数，并将回调函数的结果作为返回值返回给渲染器进程
		ipc.on("prompt", function (event, data) {
			promptManagement.createPrompt(data, function (result) {
				event.returnValue = result;
			});
		});
	},
};

promptManagement.initialize();;
/**
 * 远端菜单管理对象(右键菜单)
 * @author zhongjyuan
 * @email zhognjyuan@outlook.com
 * @website http://zhongjyuan.club
 * @date 2023年12月20日19:28:19
 */
const remoteMenuManagement = {
	/**
	 * 初始化
	 */
	initialize: function () {
		// 创建一个空的上下文菜单
		ipc.on("open-context-menu", function (e, data) {
			var menu = new Menu();

			// 遍历上下文菜单的模板，生成菜单项并添加到菜单中
			data.template.forEach(function (section) {
				section.forEach(function (item) {
					// 将菜单项的 click 事件重写为发送 "context-menu-item-selected" 的 IPC 事件，携带菜单 ID 和菜单项 ID 作为参数
					var id = item.click;
					item.click = function () {
						e.sender.send("context-menu-item-selected", { menuId: data.id, itemId: id });
					};

					// 如果菜单项有子菜单，在子菜单中也重写所有菜单项的 click 事件
					if (item.submenu) {
						for (var i = 0; i < item.submenu.length; i++) {
							(function (id) {
								item.submenu[i].click = function () {
									e.sender.send("context-menu-item-selected", { menuId: data.id, itemId: id });
								};
							})(item.submenu[i].click);
						}
					}

					// 将菜单项添加到菜单中
					menu.append(new MenuItem(item));
				});

				// 添加一个分隔符，用于分隔不同的菜单项
				menu.append(new MenuItem({ type: "separator" }));
			});

			// 监听菜单即将关闭的事件，当菜单关闭时，发送 "context-menu-will-close" 的 IPC 事件，携带菜单 ID 作为参数
			menu.on("menu-will-close", function () {
				e.sender.send("context-menu-will-close", { menuId: data.id });
			});

			// 在指定位置弹出菜单
			menu.popup({ x: data.x, y: data.y });
		});
	},
};

remoteMenuManagement.initialize();;
