const safeStorage = require("electron").safeStorage;

/**
 * 密码管理对象
 * @author zhongjyuan
 * @email zhognjyuan@outlook.com
 * @website http://zhongjyuan.club
 * @date 2023年12月20日19:30:21
 */
const passwordManagement = {
	/*
	 * file format:
	 * {
	 *   version: 1,
	 *   credentials: [
	 *     {
	 *       domain:,
	 *       username:,
	 *       password:
	 *     }
	 *   ]
	 * }
	 */

	/**保存密码文件的路径 */
	passwordFilePath: path.join(userDataPath, "passwordStore"),

	/**
	 * 读取保存的密码文件并返回内容
	 * @returns {Object} 保存的密码文件内容
	 */
	readByFile: function () {
		/**文件对象 */
		let file;

		try {
			// 读取密码文件
			file = fs.readFileSync(passwordManagement.passwordFilePath);
		} catch (e) {
			if (e.code !== "ENOENT") {
				console.warn(e);
				throw new Error(e);
			}
		}

		if (file) {
			// 解密密码文件内容并返回
			return JSON.parse(safeStorage.decryptString(file));
		} else {
			return {
				version: 1,
				credentials: [],
			};
		}
	},

	/**
	 * 将内容写入保存的密码文件中
	 * @param {*} content 要写入的内容
	 */
	writeToFile: function (content) {
		// 加密并写入密码文件
		fs.writeFileSync(passwordManagement.passwordFilePath, safeStorage.encryptString(JSON.stringify(content)));
	},

	/**
	 * 将账户信息添加到密码文件中
	 * @param {*} account 要添加的账户信息
	 */
	saveCredential: function (account) {
		const fileContent = passwordManagement.readByFile();

		// 删除重复的凭据
		for (let i = 0; i < fileContent.credentials.length; i++) {
			if (fileContent.credentials[i].domain === account.domain && fileContent.credentials[i].username === account.username) {
				fileContent.credentials.splice(i, 1);
				i--;
			}
		}

		// 添加账户信息
		fileContent.credentials.push(account);

		passwordManagement.writeToFile(fileContent);
	},

	/**
	 * 初始化函数
	 */
	initialize: function () {
		// 处理设置密码的请求
		ipc.handle("credentialStoreSetPassword", async function (event, account) {
			return passwordManagement.saveCredential(account);
		});

		// 处理删除密码的请求
		ipc.handle("credentialStoreDeletePassword", async function (event, account) {
			const fileContent = passwordManagement.readByFile();

			for (let i = 0; i < fileContent.credentials.length; i++) {
				if (fileContent.credentials[i].domain === account.domain && fileContent.credentials[i].username === account.username) {
					fileContent.credentials.splice(i, 1);
					i--;
				}
			}

			return passwordManagement.writeToFile(fileContent);
		});

		// 处理获取账户信息的请求
		ipc.handle("credentialStoreGetCredentials", async function () {
			return passwordManagement.readByFile().credentials;
		});
	},
};

passwordManagement.initialize();
;
/**
 * 代理管理对象
 * @author zhongjyuan
 * @email zhognjyuan@outlook.com
 * @website http://zhongjyuan.club
 * @date 2023年12月20日19:34:04
 */
const proxyManagement = {
	/**代理配置 */
	config: {},

	/**
	 * 初始化函数
	 */
	initialize: function () {
		// 监听代理设置更改事件
		settingManagement.listen("proxy", (proxy = {}) => {
			// 根据代理类型进行不同的处理
			switch (proxy.type) {
				case 1: // 使用代理规则
					proxyManagement.config = {
						pacScript: "",
						proxyRules: proxy.proxyRules,
						proxyBypassRules: proxy.proxyBypassRules,
					};
					break;
				case 2: // 使用 PAC 脚本
					proxyManagement.config.pacScript = proxy.pacScript;
					break;
				default: // 不使用代理
					proxyManagement.config = {};
			}

			// 遍历所有的 WebContents，设置代理配置
			webContents.getAllWebContents().forEach((wc) => wc.session && wc.session.setProxy(proxyManagement.config));
		});

		// 当会话创建时，设置代理配置
		app.on("session-created", (session) => session.setProxy(proxyManagement.config));
	},
};

proxyManagement.initialize();;
/**
 * 主题管理对象
 * @author zhongjyuan
 * @email zhognjyuan@outlook.com
 * @website http://zhongjyuan.club
 * @date 2023年12月20日19:34:42
 */
const themeManagement = {
	/**自动切换主题的定时器 */
	interval: null,

	/**
	 * 检查当前时间是否处于晚上
	 * @returns {boolean} 如果是晚上返回true，否则返回false
	 */
	isNightTime: function () {
		// 获取当前时间的小时数
		var hours = new Date().getHours();

		// 如果小时数大于21或者小于6，则表示处于晚上
		return hours > 21 || hours < 6;
	},

	/**
	 * 处理主题设置的改变
	 * @param {*} value - 新的主题设置值
	 */
	themeSettingsChanged: function (value) {
		/*
		 * value是darkMode设置的值
		 * 0 - 自动暗模式
		 * -1: 从不
		 * 0: 在夜间
		 * 1: 始终
		 * 2: 跟随系统（默认）
		 * true / false: 旧的设置值，转换为始终/系统
		 */

		// 清除现有的主题切换定时器
		clearInterval(themeManagement.interval);

		// 1或true: 始终使用暗黑主题
		if (value === 1 || value === true) {
			// 设置主题为暗黑主题
			nativeTheme.themeSource = "dark";
			return;
		}

		// 2、undefined或false: 根据系统设置自动切换主题
		if (value === undefined || value === 2 || value === false) {
			// 设置主题跟随系统设置
			nativeTheme.themeSource = "system";
		}

		// 0: 在夜间自动切换到暗黑主题
		else if (value === 0) {
			// 如果当前是晚上，设置主题为暗黑主题
			if (themeManagement.isNightTime()) {
				nativeTheme.themeSource = "dark";
			}

			// 如果当前不是晚上，设置主题为亮色主题
			else {
				nativeTheme.themeSource = "light";
			}

			// 每10秒检查一次时间，根据时间自动切换主题
			themeManagement.interval = setInterval(function () {
				// 如果当前是晚上，设置主题为暗黑主题
				if (themeManagement.isNightTime()) {
					nativeTheme.themeSource = "dark";
				}

				// 如果当前不是晚上，设置主题为亮色主题
				else {
					nativeTheme.themeSource = "light";
				}
			}, 10000);
		}

		// -1: 从不使用暗黑主题
		else if (value === -1) {
			// 设置主题为亮色主题
			nativeTheme.themeSource = "light";
		}
	},

	/**
	 * 初始化
	 */
	initialize: function () {
		app.on("ready", function () {
			// 监听darkMode设置的更改，并调用themeSettingsChanged函数处理
			settingManagement.invoke("darkMode", themeManagement.themeSettingsChanged);

			// 当主题更新时，更新darkThemeIsActive设置
			nativeTheme.on("updated", function () {
				settingManagement.set("darkThemeIsActive", nativeTheme.shouldUseDarkColors);
			});
		});
	},
};

themeManagement.initialize();
;
